@use './colors' as c;

@mixin buttonSettings {
  padding: 0.5rem;
  width: 11.25rem;
  background-color: c.$primary-color;
  font-size: 1.05rem;
  border: none;
  border-radius: 0.4rem;
  transition: background-color 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
  cursor: pointer;
  -webkit-box-shadow: 0px 2px 5px 0px rgba(120, 120, 120, 1);
  -moz-box-shadow: 0px 2px 5px 0px rgba(120, 120, 120, 1);
  box-shadow: 0px 2px 5px 0px rgba(120, 120, 120, 1);

  &:hover {
    background-color: c.$accent-hover;
    -webkit-box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
    -moz-box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
    box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
  }
}

@mixin buttonCta {
  background-color: c.$accent-color;
  -webkit-box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
  -moz-box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
  box-shadow: 0px 2px 5px 0px rgba(42, 222, 114, 1);
}

@mixin navigation {
  transition: background-color 0.3s ease-in-out, color 0.3s ease-in-out;
  &:hover {
    background-color: c.$secondary-color;
    color: c.$primary-color;
  }
}

